public void applyArgumentValidation(
		Object target, Method method, @Nullable MethodParameter[] parameters,
		Object[] arguments, Class<?>[] groups) {

	MethodValidationResult result = validateArguments(target, method, parameters, arguments, groups);
	if (!result.hasErrors()) {
		return;
	}

	if (!result.getBeanResults().isEmpty()) {
		int bindingResultCount = 0;
		for (ParameterErrors errors : result.getBeanResults()) {
			for (Object arg : arguments) {
				if (arg instanceof BindingResult bindingResult) {
					if (bindingResult.getObjectName().equals(errors.getObjectName())) {
						bindingResult.addAllErrors(errors);
						bindingResultCount++;
						break;
					}
				}
			}
		}
		if (result.getAllValidationResults().size() == bindingResultCount) {
			return;
		}
	}

	throw new HandlerMethodValidationException(
			result, this.modelAttribitePredicate, this.requestParamPredicate);
}

public Object resolveConstructorArgument(String paramName, Class<?> paramType, NativeWebRequest request)
		throws Exception {

	MultipartRequest multipartRequest = request.getNativeRequest(MultipartRequest.class);
	if (multipartRequest != null) {
		List<MultipartFile> files = multipartRequest.getFiles(paramName);
		if (!files.isEmpty()) {
			return (files.size() == 1 ? files.get(0) : files);
		}
	}
	else if (StringUtils.startsWithIgnoreCase(
			request.getHeader(HttpHeaders.CONTENT_TYPE), MediaType.MULTIPART_FORM_DATA_VALUE)) {
		HttpServletRequest servletRequest = request.getNativeRequest(HttpServletRequest.class);
		if (servletRequest != null && HttpMethod.POST.matches(servletRequest.getMethod())) {
			List<Part> parts = StandardServletPartUtils.getParts(servletRequest, paramName);
			if (!parts.isEmpty()) {
				return (parts.size() == 1 ? parts.get(0) : parts);
			}
		}
	}
	return null;
}

